import styled from 'styled-components';

export const Container = styled.div`
  height: 398px;
  background: #e5e5e5;
  .contact {
    h5 {
      font-weight: 600;
      font-size: 28px;
      line-height: 42px;
      color: #000000;
      margin-bottom: 10px;
    }
    h4 {
      margin-bottom: 30px;
    }
    h4,
    span {
      font-weight: 600;
      font-size: 24px;
      line-height: 36px;
      color: #000000;
    }
    p {
      font-size: 20px;
      color: #000000;
      line-height: 30px;
      margin: 0;
    }
  }
`;

export const Inputs = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;

  p {
    font-size: 12px;
  }

  input {
    background-color: #f5f5f7;
    margin: 0.5em;
  }
`;
